import { ADD_EXPENSE_TYPE, DELETE_EXPENSE_TYPE } from '../actions';

const INITIAL_STATE = {
  user: {
    email: '',
  },
  wallet: {
    currencies: [],
    expenses: [],
  },
};

function walletReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
  case ADD_EXPENSE_TYPE:
    return console.log('add');

  // return [...state, action.data];
  case DELETE_EXPENSE_TYPE:
    return console.log('delete'); // return state.filter((register) => register !== action.value);

  default:
    return state;
  }
}

export default walletReducer;
